import React from 'react';


const LoggedOut = () => {
  return (
    <div>
      <h4> Welcome Climbers! </h4>
      <p> Please sign in or register to continue! To demo alpha:
        <br/> Login using email: Guest@email.com and password: password
        <br/>(Hint! Try searching climbers located in Bikini Bottom)
       </p>
    </div>
  );
}

export default LoggedOut;
